import React from "react";
import "./Rentals.css";
import { Link } from "react-router-dom";
import { useLocation } from "react-router";
import { ConnectButton } from "web3uikit";
import logo from "../images/CarEth-white.png";

const Rentals = () => {
  const {state: searchFilters} = useLocation();
  return (
    <>
     <div className="topBanner">
       <div>
         <Link to="/">
           <img className="logo" src = {logo} alt="logo"></img>
         </Link>
       </div>
       <div className="searchReminder">
       <div className="filter">
         {searchFilters.location}
        </div>
        <div className="vl" />
        <div className="filter">
          {`
            ${searchFilters.pickupDate.toLocaleString("default", {month: "short",})}
            ${searchFilters.pickupDate.toLocaleString("default", {day: "2-digit",})}
            -
            ${searchFilters.returnDate.toLocaleString("default", {month: "short",})}
            ${searchFilters.returnDate.toLocaleString("default", {day: "2-digit",})}
          `}
        </div>
        <div className="vl" />
        <div className="filter"></div>
        <div className="vl" />
       </div>
       <div className="lrContainers">
         <ConnectButton />
       </div>
     </div>
    </>
  );
};

export default Rentals;
